use newjs;
CREATE TABLE `NW_INSTITUTELIST4` (
 `INSTITUTEID` int(10) unsigned NOT NULL AUTO_INCREMENT,
 `INSTITUTE` varchar(255) NOT NULL,
 `CITYID` int(11) NOT NULL,
 `SOUNDEX` varchar(150) NOT NULL,
 `ABBR` varchar(255) NOT NULL,
 PRIMARY KEY (`INSTITUTEID`),
 KEY `INSTITUTE` (`INSTITUTE`),
 KEY `SOUNDEX` (`SOUNDEX`),
 KEY `CITYID` (`CITYID`,`INSTITUTE`,`ABBR`),
 KEY `ABBR` (`ABBR`)
) ENGINE=MyISAM;
